import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../../actions/authActions";

class Index extends Component {
  onLogoutClick = e => {
    e.preventDefault();
    this.props.logoutUser();
  };

    render() {
      return (
        <div className="main-content">


          <div className="containme bg-red bg-ellipses">
                  <div className="container-fluid">
                    <div className="row justify-content-center">
                      <div className="col-md-10 col-lg-10 col-xl-8">
                        <h1 className="display-3 text-center text-white">
                          Number Theory, Combinatorics, &amp; Special Functions
                        </h1>
                        <p className="lead text-center text-grey">
                        Conference in honour of 70th birthday of Prof. A. K. Agarwal<br></br>
                        Symposia on Applied Mathematics and Engg. Mathematics
                        </p>

                      </div>
                    </div>
                  </div>
                </div>




      <div className="container-fluid">
            <div className="row mt-n7">
          <div className="col-12">


          <div className="card">
              <div className="card-body">
                <div className="row align-items-center">

                  <div className="col-12 px-4 py-3 order-lg-1">

                    <h2>
                      Admin Dashboard
                    </h2>

                    <p className="text-muted">
                     Coming Soon
                      </p>
                      <button onClick={this.onLogoutClick} className="btn btn-primary">
                    Sign Out
                    </button>

                  </div>
                </div>
              </div>
            </div>







          </div>
        </div>

            </div>
      </div>
      );
      }}


Index.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(
  mapStateToProps,
  { logoutUser }
)(Index);
